#define IMAGE_COUNT (sizeof(image_names) / sizeof(image_names[0]))
#define IMAGES_PER_PAGE 10

void decode_and_draw_image(const char *code) {
    int x = 0, y = 0;
    while (*code) {
        char c = *code++;
        int count = 0;
        while (*code >= '0' && *code <= '9') {
            count = count * 10 + (*code++ - '0');
        }
        if (count == 0) {
            count = 1;
        }
        eadk_color_t color;
        if (c >= 'A' && c <= 'Z') {
            color = palette[c - 'A'];
        } else if (c >= 'a' && c <= 'z') {
            color = palette[c - 'a' + 26];
        }
        for (int i = 0; i < count; i++) {
            eadk_display_push_rect((eadk_rect_t){x, y, 1, 1}, &color);
            x++;
            if (x >= EADK_SCREEN_WIDTH) {
                x = 0;
                y++;
            }
        }
    }
}

void draw_gallery(int selected_index, int page) {
    eadk_display_push_rect_uniform(eadk_screen_rect, eadk_color_white);
    int start_index = page * IMAGES_PER_PAGE;
    int end_index = start_index + IMAGES_PER_PAGE;
    if (end_index > IMAGE_COUNT) {
        end_index = IMAGE_COUNT;
    }
    for (int i = start_index; i < end_index; i++) {
        eadk_display_draw_string(image_names[i], (eadk_point_t){10, 10 + (i - start_index) * 20}, false, 
                                 (i == selected_index) ? eadk_color_red : eadk_color_black, eadk_color_white);
    }
    char page_str[10];
    snprintf(page_str, sizeof(page_str), "Page %d", page + 1);
    eadk_display_draw_string(page_str, (eadk_point_t){280, 10}, false, eadk_color_black, eadk_color_white);
}

int main() {
    int selected_index = 0;
    int page = 0;
    bool in_gallery = true;

    while (true) {
        if (in_gallery) {
            draw_gallery(selected_index, page);
        } else {
            decode_and_draw_image(image_code[selected_index]);
        }

        eadk_keyboard_state_t state = eadk_keyboard_scan();
        if (eadk_keyboard_key_down(state, eadk_key_home)) {
            break;
        } else if (in_gallery) {
            if (eadk_keyboard_key_down(state, eadk_key_down)) {
                selected_index++;
                if (selected_index >= (page + 1) * IMAGES_PER_PAGE || selected_index >= IMAGE_COUNT) {
                    selected_index = page * IMAGES_PER_PAGE;
                }
            } else if (eadk_keyboard_key_down(state, eadk_key_up)) {
                selected_index--;
                if (selected_index < page * IMAGES_PER_PAGE) {
                    selected_index = (page + 1) * IMAGES_PER_PAGE - 1;
                    if (selected_index >= IMAGE_COUNT) {
                        selected_index = IMAGE_COUNT - 1;
                    }
                }
            } else if (eadk_keyboard_key_down(state, eadk_key_ok)) {
                in_gallery = false;
            } else if (eadk_keyboard_key_down(state, eadk_key_one)) {
                page = 0;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_two)) {
                page = 1;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_three)) {
                page = 2;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_four)) {
                page = 3;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_five)) {
                page = 4;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_six)) {
                page = 5;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_seven)) {
                page = 6;
                selected_index = page * IMAGES_PER_PAGE;
            } else if (eadk_keyboard_key_down(state, eadk_key_eight)) {
                page = 7;
                selected_index = page * IMAGES_PER_PAGE;
            }
            
        } else {
            if (eadk_keyboard_key_down(state, eadk_key_back)) {
                in_gallery = true;
            }
        }

        eadk_timing_msleep(200); // Slower navigation
    }

    return 0;
}
